import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import App from "./App";

import "bootstrap/dist/css/bootstrap.min.css";

import { Account } from "./components/Account";

ReactDOM.render(
  <React.StrictMode>
    <Account>
      <App />
    </Account>
  </React.StrictMode>,
  document.getElementById("root")
);
